import { useState } from "react";
import axios from "axios";
import { useHistory } from "react-router-dom";


const AddProduct = () => {
    return (
        <div>
            <form>
                <div className="mb-3">
                    <label for="" className="form-label">Nama</label>
                    <input type="text" className="form-control" aria-describedby="helpId" placeholder="Nama.." />
                    <small id="helpId" className="form-text text-muted">Help text</small>
                </div>
            </form>
        </div>
    )
}

export default AddProduct
